import React from "react"

class Riset extends React.Component {
  render() {
    return (
      <div>
        <h1> Sunset </h1>
        <p> {this.props.sunset} </p>

        <h2> Sunrise </h2>
        <p> {this.props.sunrise} </p>
      </div>
    )
  }
}

export default Riset;
